def second_highest_even_element(l: list):
    (max1, max2) = (float('-inf'), float('-inf'))
    for x in l:
        if x % 2 == 0:
            if x > max1:
                (max1, max2) = (x, max1)
            elif x < max1 and x > max2:
                max2 = x
    if max1 == float('-inf') and max2 == float('-inf'):
        return 'Not enough even numbers'
    return max2

